import { Routes, Route } from "react-router-dom";
import Product from "../Product/Product";
import Cart from "../front/Cart/Cart";

function Router({productItems,cartitems,handleadd,handleremove,handleSubmit}) {
  return (
    <div>
      <Routes>
        <Route path="/"element={<Product productItems={productItems} handleadd={handleadd} />}></Route>
        <Route path="/cart" element={<Cart cartitems={cartitems}handleadd={handleadd}handleremove={handleremove}handleSubmit={handleSubmit}
            />
          }
        ></Route>
      </Routes>
    </div>
  );
}

export default Router;
